import React from "react";
import { useNavigate } from "react-router-dom";
import "./HomePage.css";

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div className="homepage-container">
      <div className="homepage-content">
        <div className="templates-preview">
          <div
            className="template-preview-card modern"
            onClick={() => navigate("/chat")}
          >
            <div className="preview-label">Modern</div>
          </div>
          <div
            className="template-preview-card professional"
            onClick={() => navigate("/chat")}
          >
            <div className="preview-label">Professional</div>
          </div>
          <div
            className="template-preview-card creative"
            onClick={() => navigate("/chat")}
          >
            <div className="preview-label">Creative</div>
          </div>
        </div>
      </div>
      <div className="background-gradient"></div>
      <div className="background-pattern"></div>
    </div>
  );
};

export default HomePage;
